window.bookSummaryJSON = "<p><b>In her global phenomenon </b><b><i>The 5 Second Rule,</i></b><b> Mel Robbins taught millions of people around the world the five second secret to motivation</b><b><i>.</i></b><b> Now she's back with another simple, proven tool you can use to take control of your life: </b><b><i>The</i></b> <b><i>High 5 Habit</i></b><b>.</b></p> <p>Don't let the title fool you. This isn't a book about high fiving everyone else in your life. You're already doing that. Cheering for your favorite teams. Celebrating your friends. Supporting the people you love as they go after what they want in life.</p> <p>Imagine if you gave that same love and encouragement to yourself. Or even better, you made it a daily habit.</p> <p><b>You'd be unstoppable.</b></p> <p>In this book, Mel teaches you how to start high fiving the most important person in your life, the one who is staring back at you in the mirror: YOURSELF.</p> <p>If you struggle with self-doubt (<i>and who doesn't?</i>)...</p> <p>If you're tired of that nagging critic in your head (<i>could somebody evict them already?</i>)...</p> <p>If you're wildly successful but all you focus on is what's going wrong (<i>you're not alone</i>)...</p> <p>If you're sick of watching everybody else get ahead while you sit on the couch with your dog (<i>don't bring your dog into this</i>)...</p> <p>...Mel dedicates this book to you.</p> <p>Using her signature science-backed wisdom, deeply personal stories, and the real-life results that <i>The High 5 Habit</i> is creating in people's lives around the world (and you'll meet a lot of them throughout this book), Mel will teach you how to make believing in yourself a habit so that you operate with the confidence that your goals and dreams demand.</p> <p><i>The High 5 Habit </i>is a simple yet profound tool that changes your attitude, your mindset, and your behavior. So be prepared to laugh and learn as you take steps to immediately boost your confidence, happiness, and results.</p> <p><b>It's time to give yourself the high fives, celebration, and support you deserve.</b></p>"; 
